import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Button, Image, SafeAreaView } from 'react-native';
import styled from 'styled-components/native/dist/styled-components.native.cjs';

const Template = styled.SafeAreaView` 

   flex:1;


`;

const Header = styled.View` 

   flex-direction:row;
   justify-content:space-between;
   align-items:center;
   background-color:gray;
   padding:20px;

`;


const Logo = styled.View` 


height:100px;
justify-content:center;

`;

const Menu = styled.View`

padding:10px;
justify-content:center;

`

const Page = styled.View` 

   flex:1;
   background-color:black;


`;


export default function App() {

  return (

    <Template>

      <Header>

         <Logo>
            <Image 
              source={require('./src/images/logotipo.png')} style={{width:180, height:100}} resizeMode="stretch"
            />
         </Logo>

         <Menu>

            <Image 
              source={require('./src/images/cardapio.png')} style={{width:60, height:60}} resizeMode="cover"
            />


         </Menu>


      </Header>

      <Page>


      </Page>


    </Template>

  )

}
